// src/app/services/bookings/booking-instructor.service.ts
import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { API } from '../endpoints.service';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root',
})
export class BookingInstructorService {

  constructor(private http: HttpClient) {}

  // GET BOOKINGS BY INSTRUCTOR
  getBookingsByInstructor(instructorId: string): Observable<any[]> {
    return this.http.get<any[]>(`${API.bookings}/instructor/${instructorId}`);
  }
}
